Well type codes:
BR	Brine; 
DH	Dry Hole; 
DS	Disposa; l
DW	Dry Wildcat; 
GD	Gas Development; 
GE	Gas Extension; 
GW	Gas Wildcat; 
IG    Injection Gas; 
IW	Enhanced Oil Recovery - Injection; 
LP	Liquefied Petroleum Gas Storage; 
MB	Monitoring Brine; 
MM	Monitoring Miscellaneous; 
MS	Monitoring Storage; 
NL	Not Listed; 
OD	Oil Development; 
OE	Oil Extension; 
OW	Oil Wildcat; 
SG	Stratigraphic; 
ST	Storage; 
TH	Geothermal

Denotes well type and status in a combined code:

CON Confidential; 
GW	Gas Well; 
GWP Gas Well Plugged; 
OW	 Oil Well; 
OWP  Oil Well Plugged; 
S	Storage Well; 
SP	Storage Well Plugged; 
SM	Solution Brine Well; 
SMP  Solution Brine Well Plugged; 
DH	Dry Hole; 
O	Other Well*; 
OP	Other Well Plugged*

*Other includes: Injection, Stratigraphic, Geothermal, and Not Listed well types.

Well status codes:

AC	Active; 
AR	Application Received to Drill/Plug/Convert; 
CA	Cancelled; 
DC	Drilling Completed; 
DD	Drilled Deeper; 
DG	Drilling in Progress; 
EX	Expired Permit; 
IN	Inactive; 
NR	Not Reported on Annual Well Report; 
PA	Plugged and Abandoned; 
PI	Permit Issued; 
PB	Plugged Back; 
PM	Plugged Back Multilateral; 
RE	Refunded Fee; 
RW	Released - Water Well; 
SI	Shut-In; 
TA	Temporarily Abandoned; 
TR	Transferred Permit; 
UN	Unknown; 
UL	Unknown Located; 
UM	Unknown Not Found; 
VP	Voided Permit

Confidential well data codes:

No            - Well does not have confidential information; 
Yes           - Well information is held confidential for 6 months after spud date; 
Extended - Confidential status has been extended for an additional 18 months; 
Released - Confidential information has been released

State Lease codes:

NA     Not Applicable; 
SD      Well on State  DOT Land; 
SP      Well on State Park Land; 
ST      Well on State DEC Land; 
SO      Well on State Other Land; 
UD     Unitized with State DOT Land; 
UP     Unitized with State Park Land; 
UT     Unitized with State DEC Land; 
UO    Unitized with Other State Land

A well located on state land or unitized with state land must pay a percentage of its revenue to the state for any oil and gas produced.

Well type specified on permit application, includes well types codes:

BR	Brine; 
DS	Disposal; 
GD	Gas Development; 
GE	Gas Extension; 
GW	Gas Wildcat; 
IG           Injection Gas; 
IW	Enhanced Oil Recovery – Injection Well; 
LP	Liquefied Petroleum Gas Storage; 
MB	Monitoring Brine; 
MM	Monitoring Miscellaneous; 
MS	Monitoring Storage; 
NL	Not Listed; 
OD	Oil Development; 
OE	Oil Extension; 
OW	Oil Wildcat; 
SG	Stratigraphic; 
ST	Storage; 
TH	Geothermal

Integration codes:

NO	- No integration order required; 
OI	- Integration order issued; 
OP	- Integration order pending; 
RE	- Referred to Office of Hearings and       Mediation Services
